INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (68397, 0, 0, 'Haha... These insects do not know their place, Karazal. If you wish to prove your might on such weaklings, it matters not to me!', 14, 0, 100, 0, 0, 35586, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (68397, 1, 0, 'You have swept the filth from my doorstep, perhaps you\'re worthy of my attention.', 14, 0, 100, 0, 0, 35587, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (68397, 2, 0, 'But your tresspass ends here! None may enter my forbidden stronghold, I shall rebuild this bridge with your bones for bricks!', 14, 0, 100, 0, 0, 35588, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71475, 10, 0, 'Sun.. Hei... Aid me!', 14, 0, 100, 0, 0, 38716, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71475, 11, 0, 'Feeling.. better.. now, little friend.', 14, 0, 100, 0, 0, 38717, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71475, 12, 0, 'You... Rook.. knows you.', 14, 0, 100, 0, 0, 38718, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71475, 13, 0, 'Rook... doesn\'t know.. head\'s cloudy', 14, 0, 100, 0, 0, 38720, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71475, 14, 0, 'Please.. help...', 14, 0, 100, 0, 0, 38722, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71475, 15, 0, 'You! are not my friend!', 14, 0, 100, 0, 0, 38724, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71475, 16, 0, 'Brawl! with rook!', 14, 0, 100, 0, 0, 38725, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71475, 17, 0, 'ROOK FIGHT!', 14, 0, 100, 0, 0, 38726, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71475, 18, 0, 'Rook needs... HELPPP!', 14, 0, 100, 0, 0, 38727, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71475, 19, 0, 'Rook... not.. Safe!', 14, 0, 100, 0, 0, 38728, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71480, 1, 0, 'Will you successeed where others has failed?', 14, 0, 100, 0, 0, 38413, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71480, 2, 0, 'We return to when we lost our way.. You are... very kind', 14, 0, 100, 0, 0, 38414, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71480, 3, 0, 'We only know despair now, a fitting punishment for our failure', 14, 0, 100, 0, 0, 38415, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71480, 4, 0, 'You too have failed!', 14, 0, 100, 0, 0, 38416, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71480, 5, 0, 'We\'ll never find solace', 14, 0, 100, 0, 0, 38417, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71480, 6, 0, 'We must redeem the vale', 14, 0, 100, 0, 0, 38418, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71480, 7, 0, 'You\'ll suffer for our failure', 14, 0, 100, 0, 0, 38419, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71480, 8, 0, 'Protectors come to my aid!', 14, 0, 100, 0, 0, 38420, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71480, 9, 0, 'We\'ll not forgive our oath', 14, 0, 100, 0, 0, 38421, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 1, 0, 'My people should\'ve taken this world long ago.. during the first war, but they failed to corruption in their weakness.. They allowed the pitiful races of Azeroth to join the Horde. I will successeed where they have failed and no power in this world can stop me!', 12, 0, 100, 0, 0, 38045, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 2, 0, 'No... it cannot end like this. What I.. What I have seen....', 12, 0, 100, 0, 0, 38046, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 3, 0, 'No.. NOOOOOOOO! THIS WORLD IS MINE DESTINY!... MY DESTiINY! ', 12, 0, 100, 0, 0, 38047, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 4, 0, 'Anger, Hatred, Fear they are weapons of war. The tools of a Warchief!', 12, 0, 100, 0, 0, 38048, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 5, 0, 'Yes... YES... I can see it now, I can see the future of the world. A world ruled by the Horde.. MY HORDE!', 12, 0, 100, 0, 0, 38051, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 6, 0, 'The old ones call to you!', 12, 0, 100, 0, 0, 38052, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 7, 0, 'The heart.. will be your END!', 12, 0, 100, 0, 0, 38053, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 8, 0, 'See the visions of fear.. despair and doubt, as I have!', 12, 0, 100, 0, 0, 38054, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 9, 0, 'You\'ll be trapped for ETERNITY!', 12, 0, 100, 0, 0, 38055, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 10, 0, 'The true Horde will COME TO PASS.. I have seen it, it has shown me.. I have seen MOUTAINS OF SKULLS AND RIVERS OF BLOOD... I WILL.. HAVE MY WORLD!!', 12, 0, 100, 0, 0, 38056, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 11, 0, '*let out a wicked grim* You think you have won... you are BLIND! I WILL FORCE YOUR EYES OPEN!', 12, 0, 100, 0, 0, 38057, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 12, 0, 'BEHOLD.. MY GLORIOUS DESTINY.. *garrosh let out a wicked cackle*', 12, 0, 100, 0, 0, 38058, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 13, 0, 'Do you remember nothing of honor.. of glory on the battlefield, you who\'d parlay with the humans, who\'d allow warlocks to practice their dark magic right under our feet.... You are weak! ', 12, 0, 100, 0, 0, 38059, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 14, 0, 'We are the Orcish Horde.. the true Horde! we die bloody and thrashing on the field of battle.. like true Orc should!', 12, 0, 100, 0, 0, 38060, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 15, 0, 'You are an Orc no longer.. and speak for none but yourself, you betrayed our people to forge a fragile alliances.. and I will take great pleasure in tearing them apart..', 12, 0, 100, 0, 0, 38061, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 16, 0, '*Garrosh laughs* Fool... my Dark shamans have twisted and tortured the elements for miles around.. They cannot hear you now. Once again you prove too weak and powerless to do ANYTHING!', 12, 0, 100, 0, 0, 38062, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 17, 0, 'I; Garrosh, son of Grom - will show you what it means to be called Hellscream!', 12, 0, 100, 0, 0, 38064, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 18, 0, 'Weak!', 12, 0, 100, 0, 0, 38065, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 19, 0, 'Hah.. pitiful', 12, 0, 100, 0, 0, 38066, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 20, 0, 'Now you know your place, in my.. new world.', 12, 0, 100, 0, 0, 38067, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 21, 0, 'Witness the power of the true Horde\'s arsenal!', 12, 0, 100, 0, 0, 38068, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 22, 0, 'We\'ll cleanse this world, with Steel and Fire!', 12, 0, 100, 0, 0, 38070, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 23, 0, 'Warbringers, ready your blade! LOKTAR-OGAR!', 12, 0, 100, 0, 0, 38071, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 24, 0, 'Farsiers, mend our wounds!', 12, 0, 100, 0, 0, 38072, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 25, 0, 'For the true Horde!', 12, 0, 100, 0, 0, 38073, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 26, 0, 'Blood and Thunder!', 12, 0, 100, 0, 0, 38074, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 27, 0, 'Die with honor!', 12, 0, 100, 0, 0, 38074, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 28, 0, 'The power... flows through me! *moans extremely angrily*!', 12, 0, 100, 0, 0, 38076, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 29, 0, 'The power to crash your world and everything on it!', 12, 0, 100, 0, 0, 38077, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 30, 0, 'I will fall! in the name of Hellscream!', 12, 0, 100, 0, 0, 38069, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 45, 0, 'So.. you wish to face against a real Orc Warchief.. so be it.', 12, 0, 100, 0, 0, 38063, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71865, 51, 0, 'Talk.. talk. talk!', 12, 0, 100, 0, 0, 38405, 'panda panda panda');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71967, 13, 0, 'The corruption is amplifying, the fragments must be purged before it becomes to great!', 14, 0, 100, 0, 0, 38903, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71967, 14, 0, 'It did not matter.. it comes.. steal your hearts and prepare your souls.', 14, 0, 100, 0, 0, 38904, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71967, 15, 0, ' Be humble!', 14, 0, 100, 0, 0, 38900, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71967, 16, 0, 'Free yourself of arrogance!', 14, 0, 100, 0, 0, 38901, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (71967, 17, 0, 'You.. must.. contain.. it.', 14, 0, 100, 0, 0, 38902, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (73330, 1, 0, 'Ah.. we adventure together again, except this time.. I\'m afraid circumstances are much.. more die', 12, 0, 100, 0, 0, 38120, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (73330, 2, 0, 'Oh.. what has become of the vale?', 12, 0, 100, 0, 0, 38121, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (73330, 3, 0, 'The land is scarred.. the everblooming trees and plants wither and die.. as the water from the pools drains away.', 12, 0, 100, 0, 0, 38122, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (73330, 4, 0, 'Come.. let us see what other horrors Garrosh has unleashed upon our land.', 12, 0, 100, 0, 0, 38123, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (73330, 5, 0, 'Once the Titans used these life-giving waters, to create and shape all life in Pandaria', 12, 0, 100, 0, 0, 38124, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (73330, 6, 0, 'It is these waters that kept the water in bloom, they run off into the the Valley of Four Winds.. created the most furtile farms in the whole world!', 12, 0, 100, 0, 0, 38125, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (73330, 7, 0, 'And now.. the Melignants of the old gods has menifested themselves into this old waters', 12, 0, 100, 0, 0, 38126, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (73330, 8, 0, 'Such a foul.. foul.. thing.. destroy it, before it seeps deep into the soil, and corrupt all of Pandaria!', 12, 0, 100, 0, 0, 38127, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (73330, 9, 0, 'Ah.. you have done it, the waters are pure once more.', 12, 0, 100, 0, 0, 38128, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (73483, 31, 0, ' It is not too late, Garrosh. Lay down the mantle of Warchief, we can end this - Now! with no more bloodshed.', 12, 0, 100, 0, 0, 38934, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (73483, 32, 0, 'Then you have forced my hand, I will correct the mistakes I made long ago.. Spirits of the Wind, the Earth, the Water! Hear my call! Come to my aid!', 12, 0, 100, 0, 0, 38935, '');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) VALUES (73483, 33, 0, 'Never powerless.. and never alone!', 12, 0, 100, 0, 0, 38936, '');
